import React from "react";
import styles from "./Navbar.module.css";

const Navbar = props => {
  return (
    <div>
      <div className="logo"></div>
      <nav>
        <a href="#">главная</a>
        <a href="#">стоимость</a>
        <a href="#">онлайн конструктор</a>
        <a href="#">почему мы</a>
        <a href="#">отзывы</a>
        <a href="#">заказать</a>
      </nav>
    </div>
  );
};

export default Navbar;
